ysis',6575),(5851,NULL,381,'Our objective is to contribute to the OSD dataset on marine microbial diversity and functions and possibly its analysis. We are particularly interested by the structure and fucntions of prokaryotic and eukaryotic communities and their in situ interactions.',6576),(5852,'&deg;C',7,'16.66',6577),(5852,NULL,17,'Micro B3',6578),(5852,'m',20,'0',6579),(5852,NULL,27,'water',6580),(5852,'psu',128,'35.22',6581),(5852,NULL,341,'408172',6582),(5852,NULL,352,'Illumina MiSeq',6583),(5852,NULL,356,'ENA MicroB3 (ERC000027)',6584),(5852,NULL,358,'OSD1,L4',6585),(5852,NULL,370,'2014-06-21T11:10:00+00',6586),(5852,NULL,371,'10 L Niskin bottle',6587),(5852,'DD',372,'50.151',6588),(5852,'DD',373,'50.151',6589),(5852,'DD',374,'-4.13',6590),(5852,'DD',375,'-4.13',6591),(5852,NULL,376,'English Channel',6592),(5852,NULL,377,'NPL022',6593),(5852,NULL,378,'OSD1_2014-06-21_0m_NPL022',6594),(5852,NULL,379,'OSD-Jun-2014',6595),(5852,NULL,380,'Research vessel - MBA SEPIA',6596),(5852,NULL,381,'To collect surface seawater on the summer solstice day from the L4 mooring in the Western English Channel (OSD1) and to filter the water using the standardized protocol NPL022. The filters will be sent to Germany and subsequently processed and analysed for the prokariotic fraction. The results will be part of the global campaign OSD data-set which will allow the scientific community to better understand the microbial diversity and function in the light of climate change assessment. The data-set so established will be used as a reference for future studies and the base for developing biotechnologies.',6597),(6528,'&deg;C',7,'12.2',6598),(6528,NULL,17,'Micro B3',6599),(6528,'m',20,'2',6600),(6528,NULL,27,'water',6601),(6528,'psu',128,'35.1354',6602),(6528,NULL,341,'408172',6603),(6528,NULL,352,'Illumina MiSeq',6604),(6528,NULL,356,'ENA MicroB3 (ERC000027)',6605),(6528,NULL,358,'OSD164,Scalloway',6606),(6528,NULL,370,'2014-06-13T10:00:00+00',6607),(6528,NULL,371,'bucket',6608),(65